import './App.css';
import { BrowserRouter,Route, Routes } from "react-router-dom";
import Home from "./Home";
import Header from "./Header.js";

function App() {
  return (
  <div className="app">
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Layout />}>
          <Route index element={<Home />} />
          <Route index element={<Header />} />
        </Route>
      </Routes>
    </BrowserRouter>
  </div>
  );
}

export default App;
